import React from "react";
import ReactFullpage from "@fullpage/react-fullpage";
import "./FullPageStyles.css";
import AboutMe from "./Sections/AboutMe";

class FullpageWrapper extends React.Component {

  render() {
    return (
      <ReactFullpage
        scrollOverflow
        sectionsColor={["#16213e", "#16213e", "#16213e", "#16213e", "#16213e", "#16213e     "]}
        menu={"#myMenu"}
        anchors={["Home", "About", "Resume", "Projects", "Gallery", "Contact"]}
        navigation
        navigationPosition={"right"}
        navigationTooltips={["Home", "About", "Resume", "Projects", "Gallery", "Contact"]}
        // onLeave={this.onLeave.bind(this)}
        // afterLoad={this.afterLoad.bind(this)}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section home-section">
                <h3>Hi, I'm James.</h3>
              </div>
              <div className="section about-section">
                <AboutMe/>
              </div>
              <div className="section resume-section">
                <h3>Resume</h3>
              </div>
              <div className="section projects-section">
                <h3>Projects</h3>
              </div>
              <div className="section gallery-section">
                <h3>Gallery</h3>
              </div>
              <div className="section contact-section">
                <h3>Contact</h3>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default FullpageWrapper;
